type UPv2ConstructorParams =
  | [signer?: Signer]
  | ConstructorParameters<typeof ContractFactory>;

const isSuperArgs = (
  xs: UPv2ConstructorParams
): xs is ConstructorParameters<typeof ContractFactory> => xs.length > 1;

export class UPv2__factory extends ContractFactory {
  constructor(...args: UPv2ConstructorParams) {
    if (isSuperArgs(args)) {
      super(...args);
    } else {
      super(_abi, _bytecode, args[0]);
    }
  }

  override deploy(
    _tokenDecimals: BigNumberish,
    _tokenName: string,
    overrides?: PayableOverrides & { from?: string | Promise<string> }
  ): Promise<UPv2> {
    return super.deploy(
      _tokenDecimals,
      _tokenName,
      overrides || {}
    ) as Promise<UPv2>;
  }
  override getDeployTransaction(
    _tokenDecimals: BigNumberish,
    _tokenName: string,
    overrides?: PayableOverrides & { from?: string | Promise<string> }
  ): TransactionRequest {
    return super.getDeployTransaction(
      _tokenDecimals,
      _tokenName,
      overrides || {}
    );
  }
  override attach(address: string): UPv2 {
    return super.attach(address) as UPv2;
  }
  override connect(signer: Signer): UPv2__factory {
    return super.connect(signer) as UPv2__factory;
  }

  static readonly bytecode = _bytecode;
  static readonly abi = _abi;
  static createInterface(): UPv2Interface {
    return new utils.Interface(_abi) as UPv2Interface;
  }
  static connect(address: string, signerOrProvider: Signer | Provider): UPv2 {
    return new Contract(address, _abi, signerOrProvider) as UPv2;
  }
}
